import React from 'react';

let timerForm = (props) => {
    return (
        <form className= "TimerForm">
            <label styles='inline'>
            </label>
            <div>
                <span>                
                    Work Time:
                </span>
                <input type="number" required
                       name="workTime"
                       value={props.workTime}
                       onChange={props.handleChange}/>
                <span> min</span>
                </div>
        </form>
    )
}

export default timerForm;
